import "./Signupbox.css";

function Signupbox() {
  return (
    <div className="outline">
      <div className="sign">
        <h2>Sign up here!</h2>
      </div>
      <div>
          <form>
              <label>Name</label>
              <input value="Name"></input>
          </form>
      </div>
    </div>
  );
}

export default Signupbox;
